    _state: {
        dialogPage: {
            messageData: [
                {message: 'Hello, World', id: 1},
                {message: 'ofvnlzkvn nlrknf', id: 2},
                {message: 'Poshel nahyi', id: 3},
                {message: 'nlsvkf nvls kvf', id: 4},
            ],
            friendData: [
                {
                    name: 'Arman',
                    id: 1,
                    image: "data:image/jpeg;base64,"
