    },
    _callObserver() {
        console.log('sdvcsv')
    },

    getState() {
        return this._state
    },
    newRenderTree(observer) {
        this._callObserver = observer;
    },

    dispatch(action) { // (type: 'ADD-POST')
        this._state.dialogPage = dialogReducer(this._state.dialogPage, action)
